import React, { useState } from 'react';
import {
    ChakraProvider,
    Box,
    Container,
    Button,
    Center,
    Image,
    SimpleGrid,
    Modal,
    ModalOverlay,
    ModalContent,
    ModalHeader,
    ModalCloseButton,
    ModalBody,
    ModalFooter,
    useDisclosure,
    Text,

} from '@chakra-ui/react';
import theme from '../../theme/theme';


const Projects = () => {

    const { isOpen, onOpen, onClose } = useDisclosure()
    const [count, setCount] = useState(0);
    const handle = (prop) => {
        setCount(prop);
        onOpen();
    };

    const handleIncrement = () => {
        setCount(0);
    };

    const projectList = [{
        id: 0,
        imageUrl: '/images/skills/upython.png',
        imageAlt: 'ECAPA-TDNN',
        projTitle: 'ECAPA-TDNN (Final Year Project)',
        projBlurb: 'ECAPA-TDNN (Emphasized Channel Attention, Propagation, and Aggregation in Time Delay Neural Network is used for Sound Event Detection',
    },
    {
        id: 1,
        imageUrl: '/images/skills/arduino.png',
        imageAlt: 'Arduino Logo',
        projTitle: 'Arduino'
    },
    {
        id: 2,
        imageUrl: '/images/skills/python.png',
        imageAlt: 'Python Logo',
        projTitle: 'Python'
    },
    {
        id: 3,
        imageUrl: '/images/skills/javascript.png',
        imageAlt: 'JavaScript',
        projTitle: 'JavaScript',
    },
    ]

    const projectModal = [{
        id: 1,
        title: 'MicroPython',
        explanation: 'Python is a popular programming language used in modern day data processing and web development.',
        experience: 'ECAPA-TDNN FYP, Personal Projects, Etc.',
        website: 'python.org'
    },
    {
        id: 2,
        title: 'Arduino',
        explanation: 'Python is a popular programming language used in modern day data processing and web development.',
        experience: 'ECAPA-TDNN FYP, Personal Projects, Etc.',
        website: 'python.org'
    },
    {
        id: 3,
        title: 'Python',
        explanation: 'Python is a popular programming language used in modern day data processing and web development.',
        experience: 'ECAPA-TDNN FYP, Personal Projects, Etc.',
        website: 'python.org'
    },
    {
        id: 3,
        imageUrl: '/images/skills/javascript.png',
        imageAlt: 'JavaScript',
        skillsText: 'JavaScript'
    },
    ]

    return (
        <ChakraProvider theme={theme}>
            <Container
                maxW='container.xl'
                bgColor='inherit'
                pb={['3vw', '1vw']}
                px={['3vw', '5vw']}
                id='skills'
            >

                <Center>
                    <Center
                        minW={['75vw', '10vw']}
                        bgColor='white'
                        borderRadius={['75vw', '10vw']}
                        border='2px'
                        color='Black'
                        padding='1vw'
                        margin='1vw'
                        fontWeight={'bold'}
                    >
                        Projects
                    </Center>
                </Center>
                <SimpleGrid columns={[1, 2, 4]} spacing='10px' >
                    {projectList.map((property) => (
                        <Box maxW='sm' borderWidth='1px' borderRadius='lg' overflow='hidden' bgColor='#EEEEEE80'>

                            <Center>
                                <Image height={{ 'base': '70px', 'sm': '50px', 'md': '100px' }} mt={{ 'base': '4px', 'sm': '3px', 'md': '10px' }} src={property.imageUrl} alt={property.imageAlt} />
                            </Center>


                            <Box p='3'>
                                <Center>
                                    <Box
                                        mt='1'
                                        fontWeight='semibold'
                                        as='h4'
                                        lineHeight='tight'
                                        noOfLines={1}
                                    >
                                        <Button bgColor={'inherit'} whiteSpace="normal" height="auto" blockSize="auto" onClick={() => handle(property.id)}>

                                            <Text padding={2}>{property.projTitle}</Text>

                                        </Button>
                                        <Box>
                                            <Text>{property.projBlurb}</Text>
                                        </Box>

                                    </Box>
                                </Center>
                                <Modal
                                    isCentered
                                    onClose={onClose}
                                    isOpen={isOpen}
                                    motionPreset='slideInBottom'
                                    blockScrollOnMount={true}
                                >
                                    <ModalOverlay
                                        bg='none'
                                        backdropFilter='blur(10px) '
                                        backdropInvert='80%'
                                        backdropBlur='2px' />
                                    <ModalContent>
                                        <ModalHeader>{projectModal[parseInt(count)].title}</ModalHeader>
                                        <ModalCloseButton />
                                        <ModalBody>
                                            {projectModal[parseInt(count)].experience}
                                            {projectModal[parseInt(count)].id}
                                        </ModalBody>
                                        <ModalFooter>
                                            <Button colorScheme='blue' mr={3} onClick={onClose}>
                                                Close
                                            </Button>
                                            <Button variant='ghost'>Secondary Action</Button>
                                        </ModalFooter>
                                    </ModalContent>
                                </Modal>


                            </Box>

                        </Box>


                    ))}

                </SimpleGrid>

            </Container >
        </ChakraProvider >
    );
}

export default Projects;
